class Solution:
    def isNStraightHand(self, hand, W):
        """
        :type hand: List[int]
        :type W: int
        :rtype: bool
        """
        handLen = len(hand)

        if handLen%W:
            return(False)
        else:
            totalGroups = int(handLen/W)

        builtHand = [[] for x in range(totalGroups)]
        sortedHand = sorted(hand)

        # print(sortedHand)

        groupViolations = 0
        for i in range(1,len(sortedHand)):
            if sortedHand[i] > sortedHand[i-1]+1:
                groupViolations += 1
            if groupViolations > totalGroups:
                return(False)

        for card in sortedHand:
            placed = False
            for group in builtHand:
                if (not group or group[-1] == card-1) and len(group) < W:
                    group.append(card)
                    placed = True
                    break
            if not placed:
                return(False)

        # print(builtHand)
        return(True)

